import React, { useEffect } from "react";
import "../../App.css";
import AOS from "aos";
import logo from "./SyImg/Logo.png";

export default function Products() {
  useEffect(() => {
    AOS.init();
    AOS.refresh();
  }, []);
  return (
    <div>

      <div className="urunler"></div>
      <h1>
        <img
          data-aos={"fade-left"}
          src={logo}
          className="App-logo"
          alt="logo"
        />
        <p>
          Edit <code>src/App.js</code> and save to reload.
        </p>
        <a
          className="App-link"
          href="https://reactjs.org"
          target="_blank"
          rel="noopener noreferrer"
        >
          Learn React
        </a>
      </h1>
    </div>
  );
}
